import { css } from '@emotion/core';
import { GoArrowUp } from "react-icons/go";

const style = css`
svg {
  fill: #838383;

}
`;

function Vote(props) {
  return (
    <div css={style}>
      <GoArrowUp />
    </ div>
  );
}

export default Vote;
